import React from 'react';
import {
    Container,
    BackgroundImage,
    Overlay,
    TextContainer,
    Title,
    Subtitle,
    LogoBox,
    Line,
    HeaderText,
} from '../styled/HeroStyles';
import backgroundImage from '../img/DaonBg.jpg';

export default function Hero() {
    return (
        <Container>
            <BackgroundImage src={backgroundImage} alt="Daon Background" />
            <Overlay />
            <TextContainer>
                <HeaderText>DaonTech</HeaderText>
                <LogoBox>
                    <Line />
                    <Title>
                        고객의 <strong>혁신적 가치</strong>와
                        <br />
                        <strong>사람을 중시</strong>하는 기업
                    </Title>
                </LogoBox>
            </TextContainer>
        </Container>
    );
}
